
<#
====================== Beigeworm's GDI Effects Tool (GUI) ==========================

SYNOPSIS
this script generates a GUI that can create and start individual GDI effects (VISUAL EFFECTS) on the desktop
(each lasts for 30 seconds before returning to normal)

USAGE
1. Run script with powershell
#>


Add-Type -AssemblyName System.Windows.Forms
Add-Type -AssemblyName System.Drawing
Add-Type -AssemblyName Microsoft.VisualBasic
[System.Windows.Forms.Application]::EnableVisualStyles()

$base64ImageString = ""
$base64ImageString+= ""
$base64ImageString+= ""
$base64ImageString+= ""
$imageBytes = [Convert]::FromBase64String($base64ImageString)
$ms = New-Object IO.MemoryStream($imageBytes, 0, $imageBytes.Length)
$ms.Write($imageBytes, 0, $imageBytes.Length);

$MainWindow = New-Object System.Windows.Forms.Form
$MainWindow.ClientSize = '300,200'
$MainWindow.Text = " | Desktop GDI Effects |"
$MainWindow.BackColor = "#242424"
$MainWindow.Opacity = 1
$MainWindow.BackgroundImage = [System.Drawing.Image]::FromStream($ms, $true)
$MainWindow.TopMost = $true
$MainWindow.Icon = [System.Drawing.Icon]::ExtractAssociatedIcon("C:\Windows\System32\DpiScaling.exe")
$MainWindow.StartPosition = 'CenterScreen'
$MainWindow.FormBorderStyle = [System.Windows.Forms.FormBorderStyle]::FixedDialog

$boxtext = New-Object System.Windows.Forms.Label
$boxtext.Text = "Desktop GDI Effects"
$boxtext.ForeColor = "#f2f2f2"
$boxtext.AutoSize = $true
$boxtext.Width = 25
$boxtext.Height = 10
$boxtext.Location = New-Object System.Drawing.Point(35, 15)
$boxtext.Font = 'Microsoft Sans Serif,14,style=Bold'

$notetext = New-Object System.Windows.Forms.Label
$notetext.Text = "GDI effects stop after 30 seconds.."
$notetext.ForeColor = "#a6a6a6"
$notetext.AutoSize = $true
$notetext.Width = 25
$notetext.Height = 10
$notetext.Location = New-Object System.Drawing.Point(38, 172)
$notetext.Font = 'Microsoft Sans Serif,10,style=Bold'

$blurButton = New-Object System.Windows.Forms.Button
$blurButton.Text = "Blur Effect"
$blurButton.Width = 120
$blurButton.Height = 30
$blurButton.Location = New-Object System.Drawing.Point(25, 50)
$blurButton.Font = 'Microsoft Sans Serif,10,style=Bold'
$blurButton.BackColor = "#eeeeee"

$invertButton = New-Object System.Windows.Forms.Button
$invertButton.Text = "Invert Colours"
$invertButton.Width = 120
$invertButton.Height = 30
$invertButton.Location = New-Object System.Drawing.Point(25, 90)
$invertButton.Font = 'Microsoft Sans Serif,10,style=Bold'
$invertButton.BackColor = "#eeeeee"

$mouseButton = New-Object System.Windows.Forms.Button
$mouseButton.Text = "Mouse Trails"
$mouseButton.Width = 120
$mouseButton.Height = 30
$mouseButton.Location = New-Object System.Drawing.Point(25, 130)
$mouseButton.Font = 'Microsoft Sans Serif,10,style=Bold'
$mouseButton.BackColor = "#eeeeee"

$msgButton = New-Object System.Windows.Forms.Button
$msgButton.Text = "Message Spam"
$msgButton.Width = 120
$msgButton.Height = 30
$msgButton.Location = New-Object System.Drawing.Point(160, 50)
$msgButton.Font = 'Microsoft Sans Serif,10,style=Bold'
$msgButton.BackColor = "#eeeeee"

$fractureButton = New-Object System.Windows.Forms.Button
$fractureButton.Text = "Fracture Effect"
$fractureButton.Width = 120
$fractureButton.Height = 30
$fractureButton.Location = New-Object System.Drawing.Point(160, 90)
$fractureButton.Font = 'Microsoft Sans Serif,10,style=Bold'
$fractureButton.BackColor = "#eeeeee"

$meltButton = New-Object System.Windows.Forms.Button
$meltButton.Text = "Melt Effect"
$meltButton.Width = 120
$meltButton.Height = 30
$meltButton.Location = New-Object System.Drawing.Point(160, 130)
$meltButton.Font = 'Microsoft Sans Serif,10,style=Bold'
$meltButton.BackColor = "#eeeeee"

$MainWindow.controls.AddRange(@($blurButton, $invertButton, $mouseButton, $msgButton, $fractureButton, $meltButton, $boxtext, $notetext))


$blurButton.Add_Click({

$b64 = ''
$decodedFile = [System.Convert]::FromBase64String($b64)
$File = "$env:temp/GDI1"+".exe"
Set-Content -Path $File -Value $decodedFile -Encoding Byte
& $File

})

$invertButton.Add_Click({

$b64 = ''
$decodedFile = [System.Convert]::FromBase64String($b64)
$File3 = "$env:temp/GDI3"+".exe"
Set-Content -Path $File3 -Value $decodedFile -Encoding Byte
& $File3

})

$MouseButton.Add_Click({

$b64 = ''
$decodedFile = [System.Convert]::FromBase64String($b64)
$File2 = "$env:temp/GDI2"+".exe"
Set-Content -Path $File2 -Value $decodedFile -Encoding Byte
& $File2

})


$msgButton.Add_Click({

$b64 = ''
$decodedFile = [System.Convert]::FromBase64String($b64)
$File6 = "$env:temp/GDI6"+".exe"
Set-Content -Path $File6 -Value $decodedFile -Encoding Byte
& $File6

})


$fractureButton.Add_Click({

$b64 = ''
$decodedFile = [System.Convert]::FromBase64String($b64)
$File5 = "$env:temp/GDI5"+".exe"
Set-Content -Path $File5 -Value $decodedFile -Encoding Byte
& $File5

})


$meltButton.Add_Click({

$b64 = ''
$decodedFile = [System.Convert]::FromBase64String($b64)
$File4 = "$env:temp/GDI4"+".exe"
Set-Content -Path $File4 -Value $decodedFile -Encoding Byte
& $File4

})

$MainWindow.ShowDialog() | Out-Null

Remove-Item -Path $env:temp/GDI1.exe -Force
Remove-Item -Path $env:temp/GDI2.exe -Force
Remove-Item -Path $env:temp/GDI3.exe -Force
Remove-Item -Path $env:temp/GDI4.exe -Force
Remove-Item -Path $env:temp/GDI5.exe -Force
Remove-Item -Path $env:temp/GDI6.exe -Force

exit

